from typing import List
class Solution:
    def combine(self, n: int, k: int) -> List[List[int]]:
        # use to store all answers
        ans = []
        # combination list that maybe a answer
        temp = []

        # i is the item we want put in comb list
        # t is the len of comb list
        def comb(i, t):
            # if len is k then comb list is full and be an answer
            if t == k:
                ans.append(temp[:])
                return
            # item out of range
            if i == n+1:
                return
            # comb list get the item
            temp.append(i)
            # try to add next item
            comb(i+1, t+1)
            # comb list don't get the item
            temp.remove(i)
            # try to add next item
            comb(i+1, t)
        comb(1,0)
        return ans

class Solution:
    def combine(self, n: int, k: int) -> List[List[int]]:
        ans = []
        temp = []
        def pick(i, t):
            if t == k:
                ans.append(temp[:])
                return
            # if numbers in i..n can't fill temp to k
            # we can break immediately
            if k-t+i-1>n:
                return
            if i == n+1:
                return
            temp.append(i)
            pick(i+1, t+1)
            # here can use pop since the new item always add in tail
            temp.pop()
            pick(i+1, t)
        pick(1,0)
        return ans

class Solution:
    def combine(self, n: int, k: int) -> List[List[int]]:
        ans = []
        temp = []
        def pick(i):
            if len(temp) == k:
                ans.append(temp[:])
                return
            if k-len(temp)+i-1>n:
                return
            if i == n+1:
                return
            temp.append(i)
            pick(i+1)
            temp.pop()
            pick(i+1)
        pick(1)
        return ans

